  const IMG = "https://image.tmdb.org/t/p/w1280";
  return (
          <div className="container-fluid">
              <div className="movie">
              <img src={IMG + poster_path} alt={title} />
              <div className="movie-info">
                  {title}
                <span>Ratings:{vote_average}</span>

              </div>
              </div>

          </div>

  );
};

export default Movies;
